import React from 'react';

const Main = () => {
  return (
    <main className="main-page">
      <section className="hero-section">
        <h1 className="main-title">Welcome to Elite Cars</h1>
        <p className="main-description">
          Discover the ultimate selection of luxury and high-performance vehicles at Elite Cars.
          Whether you're looking for speed, style, or sophistication, our collection is tailored to meet the highest standards.
        </p>
        <p className="main-highlight">
          <strong>Why choose us?</strong> Each car is handpicked to ensure the best quality and performance for our customers. Experience the thrill of owning a luxury car today.
        </p>
        <a href="/catalog" className="explore-button">Explore Our Collection</a>
      </section>
    </main>
  );
};

export default Main;
